			}
			int[] startTile = new int[] { (int)((move >> 17) % 8), (int)((move >> 17) / 8 )};
			int[] endTile = new int[] { (int)(((move >> 11)&0x3f) % 8), (int)(((move >> 11)&0x3f) / 8 )};
